import styles from "./Sidebar.module.css"; // ⬅️ без ../../
import careerIcon from "../../Images/career.png";
import { useNavigate } from "react-router-dom";

export default function Career() {
  const navigate = useNavigate();

  return (
    <div className={styles.career} onClick={() => navigate("/career")}>
      <img src={careerIcon} alt="Career" className={styles.careerImage} />
      <button className={styles.careerButton}>Career</button>
    </div>
  );
}
